import React from 'react'
import './FullPreview.css';

const FullPreview = (props) => {
    return(
        <>
           <div className="Preview">
            {props.movies.map((movie, index) => (
                <div id='FullPreview'>
                    <img src={movie.Poster} alt='Image'/>
                    <h1>{movie.Title}</h1>
                    <h2>{movie.Year}</h2>
                    <h3>{movie.Type}</h3>
                    <h4>{movie.imdbID}</h4>
                </div>
            ))} 
           </div>
        </>
    );
}

export default FullPreview;
